// HRID utilities

/**
 * Check if a avatar HRID is valid
 */
export function validateAvatarHrid(hrid: string): hrid is AvatarHrid {
  return hrid in AVATARS
}

/**
 * Check if a avatar exists
 */
export function avatarExists(hrid: string): boolean {
  return hrid in AVATARS
}

// Getter functions
export function getAvatar(hrid: AvatarHrid): Avatar {
  return AVATARS[hrid]
}

export function getAllAVATARS(): Avatar[] {
  return Object.values(AVATARS)
}

export function getAVATARSSortedByIndex(): Avatar[] {
  return getAllAVATARS().sort((a, b) => (a.sortIndex || 0) - (b.sortIndex || 0))
}

// Type exports
export type { Avatar }
export type { AvatarHrid }
export type AvatarId = keyof typeof AVATARS
export type AvatarData = typeof AVATARS

export const FREE_AVATARS = Object.values(AVATARS).filter(avatar => avatar.cowbellCost === 0)

export const PAID_AVATARS = Object.values(AVATARS).filter(avatar => avatar.cowbellCost > 0)

export const SEASONAL_AVATARS = Object.values(AVATARS).filter(avatar => avatar.isSeasonal)

export const NON_SEASONAL_AVATARS = Object.values(AVATARS).filter(avatar => !avatar.isSeasonal)

export const AVATARS_SORTED = [...Object.values(AVATARS)].sort((a, b) => a.sortIndex - b.sortIndex)


export function getAvatarCost(hrid: AvatarHrid): number {
  return AVATARS[hrid].cowbellCost
}

export function isAvatarFree(hrid: AvatarHrid): boolean {
  return AVATARS[hrid].cowbellCost === 0
}

export function isAvatarSeasonal(hrid: AvatarHrid): boolean {
  return AVATARS[hrid].isSeasonal
}

export function getAvatarsByCostRange(minCost: number, maxCost: number): Avatar[] {
  return Object.values(AVATARS).filter(
    avatar => avatar.cowbellCost >= minCost && avatar.cowbellCost <= maxCost
  )
}

export function getAffordableAvatars(cowbells: number): Avatar[] {
  return Object.values(AVATARS).filter(avatar => avatar.cowbellCost <= cowbells)
}